    false,nt"url": null,nt"notes": "Eelgrass bed areas in Tomales Bay were
    digitized from 2010 CDFW aerial imagery. Photographs were taken on 6/29/2010 on
    the incoming tide following a -0.5 ft. low at 08:25. Photographs were georeferenced
    5/6-5/8/2013. Ground-truthing took place 5/13/2013-7/25/2013 This feature was finalized
    on 7/26/2013.Bed areas in the Estero Americano were surveyed between June and September
    2014 by CDFW staff using global positioning system (GPS) technology, observation,
    and field notes. Polygon features were digitized from the survey data with the aid
    of 2012 National Agriculture Imagery Program (NAIP) imagery. Bed areas in the Albion
    River estuary were initially surveyed on 10/3/2014 by CDFW staff using GPS, observations,
    and field notes, with a follow-up survey on 5/21/2015. Polygon features were digitized
    from the survey data with the aid of 2012 NAIP imagery. Bed areas in the Big River
    estuary were surveyed on 9/21/2015 by CDFW staff using global positioning system
    (GPS) technology, observations, and field notes. Polygon features were digitized
    from the survey data with the aid of 2012 NAIP imagery.The resulting shapefile is
    a partial representation of eelgrass (Zostera marina) habitat in northern California's
    bays and estuaries. Itis a work in progress and will be updated to include additional
    estuaries as data become available.",nt"license_title": null,nt"extras":
